    "2016-07-27T22:42:14.892250",nt"name": "partial-report-of-findings-no-1-cape-newenham-military-cleanup-togiak-national-wildlife-re",nt"isopen":
    false,nt"url": null,nt"notes": "Data analyzed to date indicate that high
    PCB concentrations have been detected at the U.S. Air Force's Cape Newenham Air
    Force Station and pose a threat to Refuge wildlife resources. We are currently composing
    a letter to the U.S. Air Force informing them of our findings and requesting that
    they: 1) evaluate potential effects of the PCB contamination to personnel stationed
    on-site, and 2) initiate remedial actions in consultation with the Environmental
    Protection Agency, Alaska Department of Environmental Conservation, and Fish and
    Wildlife Service. The proposed letter will be coordinated through our Regional Office.
    Your input in the remediation process is essential; therefore, we will be continually
    coordinating with the Refuge on this matter until it is solved to the Service's
    satisfaction. Remaining polynuclear aromatic hydrocarbon and trace element data,
    when fully interpreted, may identify additional contaminant problems.",nt"license_title":
